(function (module) {
	
	var device, 
		bassSampler,
		kickSampler,
		hatSampler,
		snareSampler,
		channels 		= 2,
		tempo 			= 120,
		tick 			= 0,
		noteLength 		= 0,
		pitch 			= 0,
		stepCount 		= 32,
		pitchCount 		= 10,
		noteDuration 	= 0.0625,
		notesPerBeat 	= 4,
		semitone		= 1.05946,
		bassSequence 	= [],
		kickSequence 	= [],
		snareSequence 	= [],
		hatSequence 	= [],
		fft,
		width			= 600,
		height			= 200,
		waveScale 		= -2000,
		context,
		fps 			= 60,
		gradient,
		canvas;
	
	var kickRaw = '';
	var clapRaw = '';
	var shakeRaw = '';
	var bassRaw = '';
		
	$(document).ready(function () {		
		canvas	  	= document.getElementById('canvas');
		context		= canvas.getContext('2d');
		
		width = canvas.width;
		height = canvas.height;
		
		gradient = context.createLinearGradient(0, 0, 0, height/2);
		gradient.addColorStop(0, "#ff0000");
		gradient.addColorStop(1, "#0000ff");

		
		
		loadSequence(bassSequence);
		loadSequence(kickSequence);
		loadSequence(snareSequence);
		loadSequence(hatSequence);
		loadAudio();
		loadUI();
	});
		
	function audioCallback(buffer, channelCount) {
	
		var current, l = buffer.length, sample = 0, n;
		for (current = 0; current < l; current += channelCount) {
		
			if (noteLength <= 0) advanceStep();
		
			bassSampler.generate();
			kickSampler.generate();
			snareSampler.generate();
			hatSampler.generate();
			
			sample = bassSampler.getMix() * 0.7;
			sample += kickSampler.getMix() * 0.7;
			sample += snareSampler.getMix() ;
			sample += hatSampler.getMix() * 0.5;
			
			fft.pushSample(sample);

			for (n = 0; n < channelCount; n++){
				buffer[current + n] = sample;
			}
			
			noteLength -= 1;
		}
	}
	
	function loadAudio() {
		device = audioLib.AudioDevice(audioCallback, channels);
		fft = audioLib.FFT(device.sampleRate, 4096);		
		bassSampler = audioLib.Sampler(device.sampleRate);
		kickSampler = audioLib.Sampler(device.sampleRate);
		snareSampler = audioLib.Sampler(device.sampleRate);
		hatSampler = audioLib.Sampler(device.sampleRate);

		bassRaw = atob(bassRaw);
		kickRaw = atob(kickRaw);
		clapRaw = atob(clapRaw);
		shakeRaw = atob(shakeRaw);
		
    	bassSampler.loadWav(bassRaw, true);
    	kickSampler.loadWav(kickRaw, true);
    	snareSampler.loadWav(clapRaw, true);
    	hatSampler.loadWav(shakeRaw, true);
				
		advanceStep();
	}
	
	function loadUI () {

		// BASS //	
		var div = $('#bass');
		loadRadioSection(div, pitchCount, 'bass');
		$('#bass input').change( function () {
			updateSequence(bassSequence, $(this));
		});

		// KICK //	
		var kickDiv = $('#kick');
		loadRadioSection(kickDiv, 5, 'kick');
		$('#kick input').change( function () {
			updateSequence(kickSequence, $(this));
		});

		// SNARE //	
		var snareDiv = $('#snare');
		loadRadioSection(snareDiv, 5, 'snare');
		$('#snare input').change( function () {
			updateSequence(snareSequence, $(this));
		});

		// HI HAT //	
		var hatDiv = $('#hat');
		loadRadioSection(hatDiv, 5, 'hat');
		$('#hat input').change( function () {
			updateSequence(hatSequence, $(this));
		});
		
		$('#tempoSlider').slider( {
			min: 60,
			max: 400,
			value: tempo,
			change: function (event, ui) { tempo = ui.value; },
			slide: function (event, ui) { tempo = ui.value; },
		});
	}
	
	function updateSequence(targetSequence, radio) {
		var value = radio.val();
		var on = radio.attr('checked') !== undefined;
		var splits = value.split(',');
		var stepObject = targetSequence[parseInt(splits[0])];
		var row = parseInt(splits[1]);
		stepObject.row = row;	
	}
	
	function loadRadioSection(targetDiv, rowCount, group) {
	
		for (var row = 0; row < rowCount; row++) {
			
			var div = $('<div>');
			if (row % 2 === 0) {
				div.attr('class', 'alt');
			}
			div.appendTo(targetDiv);
			
			$('<span>' + row.toString() + '</span>').appendTo(div);
			
			for (var col = 1; col <= stepCount; col++) {
					
				var button = 
					$('<input name="' + group + col.toString() + '" value="' + (col-1).toString() + ',' + row.toString() + 
						'" type="radio">');
				if (col % 4 == 0) {
					button.attr('class', 'fourth');
				}						
				button.appendTo(div);
			
			}		
		}		
	}
	
	function loadSequence (targetSequence) {
		var stepObject;
		
		for (var step = 0; step < stepCount; step++) {
			stepObject = {};
			stepObject.row = 0;
			targetSequence.push(stepObject);
		}	
	}
	
	function advanceStep(){
	
		var step = bassSequence[tick];
		if (step.row > 0) {
			pitch = getHz(step.row);
			bassSampler.noteOn(pitch);
		}

		step = kickSequence[tick];
		if (step.row > 0) {
			pitch = getHz(step.row);
			kickSampler.noteOn(pitch);
		}

		step = snareSequence[tick];
		if (step.row > 0) {
			pitch = getHz(step.row);
			snareSampler.noteOn(pitch);
		}

		step = hatSequence[tick];
		if (step.row > 0) {
			pitch = getHz(step.row);
			hatSampler.noteOn(pitch);
		}

		// Calculate note length in samples
		noteLength = Math.floor(noteDuration * device.sampleRate * 60 * notesPerBeat / tempo);		
		tick = (tick + 1) % stepCount;

	};
	
	function getHz (row) {
		return 440 * Math.pow(semitone, -(row - 1));	
	}

	function drawFFT () {
	
		var y = height / 2;

		context.clearRect ( 0, 0, width, height);
		context.beginPath();
		context.fillStyle = gradient; //'rgb(200,0,0)';
		context.moveTo(0, y);
		var l = fft.spectrum.length / 8;

		for (i=0; i<l; i++){
			context.lineTo(i / l * width, fft.spectrum[i] * waveScale + y);
		}
		context.moveTo(width,0);
		context.closePath();
		context.fill();
		context.stroke();	
	}
	
	Sink.doInterval(function(){ 
    
    	drawFFT();
    
	}, 1000/fps);

	
})();